import React, { useEffect, useState } from 'react';
import { Container, Grid, List, ListItem, ListItemIcon, ListItemText, Avatar } from '@mui/material';
import { Home, Inbox, Mail, LiveTv, ViewComfy, Timeline, MoreHoriz } from '@mui/icons-material';
import { Link } from 'react-router-dom';
import logo from './assets/secura.png';
import './App.css';

const App = () => {
  const [userData, setUserData] = useState({ name: '', avatar: '' });

  useEffect(() => {
    fetchUserData().then(data => {
      setUserData(data);
    });
  }, []);

  const fetchUserData = async () => {
    const response = await fetch('https://jsonplaceholder.typicode.com/users/1');
    const data = await response.json();
    return data;
  };

  return (
    <div className="pageStyles">
      <Container>
        <Grid container>
          <Grid className="sidebarStyles">
            <img src={logo} alt="Logo" className="logoStyles" />
            <List className="iconList">
              <Link to="/home">
                <ListItem className="iconListItem">
                  <ListItemIcon sx={{ color: 'white', marginRight: '10px' }}>
                    <Home />
                  </ListItemIcon>
                  <ListItemText primary="Home" />
                </ListItem>
              </Link>
              <Link to="/inbox">
                <ListItem className="iconListItem">
                  <ListItemIcon sx={{ color: 'white', marginRight: '10px' }}>
                    <Inbox />
                  </ListItemIcon>
                  <ListItemText primary="Inbox" />
                </ListItem>
              </Link>
              <Link to="/mail">
                <ListItem className="iconListItem">
                  <ListItemIcon sx={{ color: 'white', marginRight: '10px' }}>
                    <Mail />
                  </ListItemIcon>
                  <ListItemText primary="Mail" />
                </ListItem>
              </Link>
            </List>
          </Grid>
          <Grid item xs={6}>
            {/* Main content */}
          </Grid>
        </Grid>
      </Container>
    </div>
  );
};

export default App;
